// src/pages/Evento/NovoEventoCliente.jsx
import React, { useState, useEffect } from 'react';
import { useNavigate } from 'react-router-dom';
import api from '../../services/api';

const NovoEventoCliente = () => {
  const navigate = useNavigate();
  const dono = JSON.parse(localStorage.getItem('usuario'));
  const [pets, setPets] = useState([]);
  const [form, setForm] = useState({
    tipo: 'Hospedagem',
    pet: '',
    dataEntrada: '',
    observacoes: '',
  });
  const [erro, setErro] = useState('');

  useEffect(() => {
    const carregarPets = async () => {
      try {
        const { data } = await api.get(`/pets`);
        const petsDoDono = data.filter(pet => pet.dono === dono._id);
        setPets(petsDoDono);
      } catch (error) {
        console.error('Erro ao carregar pets:', error);
      }
    };

    carregarPets();
  }, [dono._id]);

  const handleChange = (e) => {
    const { name, value } = e.target;
    setForm(prev => ({ ...prev, [name]: value }));
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    const dados = {
      ...form,
      dono: dono._id,
    };

    console.log('📦 Enviando dados do evento (cliente):', dados);

    try {
      await api.post('/eventos', dados);
      navigate('/cliente');
    } catch (err) {
      console.error('❌ Erro ao registrar evento:', err.response?.data || err.message);
      setErro('Erro ao salvar evento. Verifique os campos e tente novamente.');
    }
  };

  return (
    <div className="container mt-4 p-4 bg-white rounded shadow">
      <h2 className="mb-3">Novo Evento (Cliente)</h2>
      {erro && <div className="alert alert-danger">{erro}</div>}
      <form onSubmit={handleSubmit}>
        <div className="mb-3">
          <label className="form-label">Tipo de Evento:</label>
          <select className="form-select" name="tipo" value={form.tipo} onChange={handleChange} required>
            <option value="Hospedagem">Hospedagem</option>
            <option value="Passeio">Passeio</option>
            <option value="Banho">Banho</option>
            <option value="Consulta">Consulta</option>
            <option value="Alimentacao">Alimentação</option>
            <option value="Recreacao">Recreação</option>
          </select>
        </div>

        <div className="mb-3">
          <label className="form-label">Pet:</label>
          <select className="form-select" name="pet" value={form.pet} onChange={handleChange} required>
            <option value="">Selecione um pet</option>
            {pets.map(pet => (
              <option key={pet._id} value={pet._id}>
                {pet.nome}
              </option>
            ))}
          </select>
        </div>

        <div className="mb-3">
          <label className="form-label">Data de Entrada:</label>
          <input
            type="datetime-local"
            className="form-control"
            name="dataEntrada"
            value={form.dataEntrada}
            onChange={handleChange}
            required
          />
        </div>

        <div className="mb-3">
          <label className="form-label">Observações:</label>
          <textarea
            className="form-control"
            name="observacoes"
            value={form.observacoes}
            onChange={handleChange}
            rows="3"
          />
        </div>

        <button type="submit" className="btn btn-primary">Salvar Evento</button>
      </form>
    </div>
  );
};

export default NovoEventoCliente;
